import TipPercent from "./TipPercent";
import { useState, useEffect } from "react";

function TipBoard({ percentList }) {
  return (
    <section className="tipboard-box">
      <p>Select Tip %</p>
      <div className="percent-box">
        {percentList.map((perc, ind) => {
          return <TipPercent key={ind} perc={perc} />;
        })}

        <input className="percent-input" type="text" placeholder="Custom" />
      </div>
    </section>
  );
}

export default TipBoard;
